import React, { Component } from "react";
import { Router as RouterBase, Link as LinkBase } from "@reach/router";
import { Flex as FlexBase, Heading, Text } from "rebass";
import styled from "styled-components";
import { minHeight, space, width } from "styled-system";

import Navbar from "./components/Navbar";
import StockTracker from "./components/StockTracker";
import PersonalLibrary from "./components/PersonalLibrary";

const Router = styled(RouterBase)`
  ${space}
  ${width}
`;

const Flex = styled(FlexBase)`
  ${minHeight}
`;
class App extends Component {
  render() {
    return (
      <Flex
        flexDirection="column"
        bg="pink"
        minHeight="100vh"
        alignItems="center"
        // justifyContent="center"
        width={[1]}
        className="App"
      >
        <Flex bg="indigo" p={3} flexDirection="row" width={[1]}>
          <Navbar />
        </Flex>
        <Router width={1}>
          <Home path="/" />
          <PersonalLibrary path="/library" />
          <StockTracker path="/stocks" />
        </Router>
      </Flex>
    );
  }
}
export default App;

const Home = () => <div>Home</div>;
